		player_resource = *reinterpret_cast<c_cs_player_resource * **>(utils::pattern_scan(PLAYER_RESOURCE) + 2);
		glow_obj_manager = *(CGlowObjectManager * *)(utils::pattern_scan(GLOW_MANAGER) + 3);
